using Microsoft.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore.Metadata.Builders;
using SimplyForum.Infrastructure.Data.Models;
using System.Globalization;

namespace SimplyForum.Infrastructure.Data.Configuration
{
    public class CommunityConfiguration : IEntityTypeConfiguration<Community>
    {
        public void Configure(EntityTypeBuilder<Community> builder)
        {
            builder.HasData(CreateCommunities());
        }

        private List<Community> CreateCommunities()
        {
            string bannerStr = "";
            List<byte> byteList = new List<byte>();

            string hexPart = bannerStr.Substring(2);
            for (int i = 0; i < hexPart.Length / 2; i++)
            {
                string hexNumber = hexPart.Substring(i * 2, 2);
                byteList.Add((byte)Convert.ToInt32(hexNumber, 16));
            }
            byte[] bannerImage = byteList.ToArray();

            string profileStr = "";
            byteList = new List<byte>();

            hexPart = profileStr.Substring(2);
            for (int i = 0; i < hexPart.Length / 2; i++)
            {
                string hexNumber = hexPart.Substring(i * 2, 2);
                byteList.Add((byte)Convert.ToInt32(hexNumber, 16));
            }
            byte[] communityImage = byteList.ToArray();


            return new List<Community>()
            {
                new Community()
                {
                    Id = Guid.ParseExact("89B69807-D8A3-4BEF-92DE-130408B42879","D"),
                    Name = "Songs",
                    CreatedOn = DateTime.UtcNow,
                    CategoryId = Guid.ParseExact("F4863175-B536-4D9C-8FCD-9230C9A48CF1","D"),
                    AuthorId = "477194ee-abb3-40c2-9e5b-9c7222ed600f",
                    BannerImage = bannerImage,
                    CommunityImage = communityImage
                },
                new Community()
                {
                    Id = Guid.ParseExact("395C1600-768C-47DB-BCE4-CA771FFA8D2E","D"),
                    Name = "Games",
                    CreatedOn = DateTime.UtcNow,
                    CategoryId = Guid.ParseExact("52BF3597-B6D0-4959-B922-CE3F1D6D2E94","D"),
                    AuthorId = "648a1ea7-a0d3-4aba-8316-cd702f2be4d9",
                    BannerImage = bannerImage,
                    CommunityImage = communityImage
                },
                new Community()
                {
                    Id = Guid.ParseExact("CDFF2380-02CB-4DDF-9DDE-32777D6AAE8C","D"),
                    Name = "Memes",
                    CreatedOn = DateTime.UtcNow,
                    CategoryId = Guid.ParseExact("F579F2A3-0573-49F0-B0B5-EFA8F52BBBF9","D"),
                    AuthorId = "e84bc3c9-cf00-462a-8505-9ae520533e85",
                    BannerImage = bannerImage,
                    CommunityImage = communityImage
                }
            };
        }
    }
}
